__NUXT_JSONP__("/drugs/Dactolisib", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"915019-65-7",chebiId:b,chemicalFormula:b,definition:"An orally bioavailable imidazoquinoline targeting the phosphatidylinositol 3 kinase (PI3K) and the mammalian target of rapamycin (mTOR), with potential antineoplastic activity. Dactolisib inhibits PI3K kinase and mTOR kinase in the PI3K\u002FAKT\u002FmTOR kinase signaling pathway, which may result in tumor cell apoptosis and growth inhibition in PI3K\u002FmTOR-overexpressing tumor cells. Activation of the PI3K\u002FmTOR pathway promotes cell growth, survival, and resistance to chemotherapy and radiotherapy; mTOR, a serine\u002Fthreonine kinase downstream of PI3K, may also be activated independent of PI3K.",fdaUniiCode:"RUJ6Z9Y0DT",identifier:"C74072",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C2152"],synonyms:["BEZ235","Benzeneacetonitrile, 4-(2,3-Dihydro-3-methyl-2-oxo-8-(3-quinolinyl)-1H-imidazo(4,5-c)quinolin-1-yl)-alpha,alpha-dimethyl-","DACTOLISIB",a,"NVPBEZ235"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FDactolisib",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Dactolisib","","2021-10-30T13:44:20.783Z")));